          <tspan x="492.64355" y="235.51367" id="tspan3">
            <tspan style="stroke: none" id="tspan2">Certificate of Achievement</tspan>
          </tspan>
          <tspan x="599.51855" y="255.51367" id="tspan5">
            <tspan style="stroke: none" id="tspan4"></tspan>
          </tspan>
          <tspan x="241.38965" y="275.51367" id="tspan7">
            <tspan style="stroke: none" id="tspan6">
              We are pleased to present this Certificate of Achievement to {{ name }}, in
              recognition of
            </tspan>
          </tspan>
          <tspan x="267.11621" y="295.51367" id="tspan9">
            <tspan style="stroke: none" id="tspan8">
              his exceptional accomplishment in attaining the rank of {{ tittle }} with the highest
            </tspan>
          </tspan>
          <tspan x="253.46387" y="315.51367" id="tspan11">
            <tspan style="stroke: none" id="tspan10">
              honors. This prestigious title is a testament to {{ name }}'s dedication, hard work,
              and
            </tspan>
          </tspan>
          <tspan x="450.84668" y="335.51367" id="tspan13">
            <tspan style="stroke: none" id="tspan12">unwavering commitment to his craft.</tspan>
          </tspan>
          <tspan x="599.51855" y="355.51367" id="tspan15">
            <tspan style="stroke: none" id="tspan14"></tspan>
          </tspan>
          <tspan x="267.13965" y="375.51367" id="tspan17">
            <tspan style="stroke: none" id="tspan16">
              As a {{ tittle }}, {{ name }} has demonstrated an unparalleled level of mastery and
            </tspan>
          </tspan>
          <tspan x="260.32715" y="395.51367" id="tspan19">
            <tspan style="stroke: none" id="tspan18">
              expertise in his field. His outstanding performance and impressive track record have
            </tspan>
          </tspan>
          <tspan x="312.12402" y="415.51367" id="tspan21">
            <tspan style="stroke: none" id="tspan20">
              earned him the respect and admiration of his peers and superiors alike.
            </tspan>
          </tspan>
          <tspan x="247.35449" y="435.51367" id="tspan23">
            <tspan style="stroke: none" id="tspan22">
              We are confident that he will continue to excel and make significant contributions to
              his
            </tspan>
          </tspan>
          <tspan x="494.52246" y="455.51367" id="tspan25">
            <tspan style="stroke: none" id="tspan24">field in the years to come.</tspan>
          </tspan>
          <tspan x="599.51855" y="475.51367" id="tspan27">
            <tspan style="stroke: none" id="tspan26"></tspan>
          </tspan>
          <tspan x="250.60449" y="495.51367" id="tspan29">
            <tspan style="stroke: none" id="tspan28">
              We would like to extend our heartiest congratulations to {{ name }} on this remarkable
            </tspan>
          </tspan>
          <tspan x="275.68652" y="515.51367" id="tspan31">
            <tspan style="stroke: none" id="tspan30">
              achievement, and we wish him continued success and prosperity in all his future
            </tspan>
          </tspan>
          <tspan x="554.99512" y="535.51367" id="tspan33">
            <tspan style="stroke: none" id="tspan32">endeavors.</tspan>
          </tspan>
          <tspan x="599.51855" y="555.51367" id="tspan35">
            <tspan style="stroke: none" id="tspan34"></tspan>
          </tspan>
          <tspan x="560.29199" y="575.51367" id="tspan37">
            <tspan style="stroke: none" id="tspan36">Sincerely,</tspan>
          </tspan>
